from typing import *
from functools import lru_cache
import time

class Solution:
    def numWays(self, words: List[str], target: str) -> int:
        max_word_length = len(max(words))
        mod = 10 ** 9 + 7

        @lru_cache(None)
        def dp(pointer, curr_word):
            if pointer >= max_word_length:
                return 0
            elif curr_word == target:
                return 1

            answer = 0
            # visited = {}
            for i in range(pointer + 1, max_word_length):
                for word in words:
                    # curr_char = (i, word[i])
                    # if curr_char[1] in visited:
                    #     answer += visited[curr_char]
                    #     continue
                    if i >= len(word):
                        continue
                    elif target[len(curr_word)] != word[i]:
                        continue

                    curr = dp(i, curr_word + word[i])
                    # visited[curr_char] = curr
                    answer += curr

            return answer % mod

        return dp(-1, "")





